INSERT INTO `ps_info_lang` VALUES(1, 1, '<ul><li><em class="icon-truck" id="icon-truck"></em>\n<div class="type-text">\n<h3>Lorem Ipsum</h3>\n<p>Lorem ipsum dolor sit amet conse ctetur voluptate velit esse cillum dolore eu</p>\n</div>\n</li>\n<li><em class="icon-phone" id="icon-phone"></em>\n<div class="type-text">\n<h3>Dolor Sit Amet</h3>\n<p>Lorem ipsum dolor sit amet conse ctetur voluptate velit esse cillum dolore eu</p>\n</div>\n</li>\n<li><em class="icon-credit-card" id="icon-credit-card"></em>\n<div class="type-text">\n<h3>Ctetur Voluptate</h3>\n<p>Lorem ipsum dolor sit amet conse ctetur voluptate velit esse cillum dolore eu</p>\n</div>\n</li>\n</ul>');
INSERT INTO `ps_info_lang` VALUES(1, 2, '<ul><li><em class="icon-truck" id="icon-truck"></em>\n<div class="type-text">\n<h3>Giao hàng</h3>\n<p>Fashionmen shop giao hàng miễn phí trong Quận 5, HCM. Nếu khách hàng ở những quận khác sẽ tính phí vận chuyển 50,000 VNĐ. Đối với khách hàng ở tĩnh khác sẽ gửi qua đường bưu điện, cước vận chuyển khách hàng sẽ thanh toán.</p>\n</div>\n</li>\n<li><em class="icon-phone" id="icon-phone"></em>\n<div class="type-text">\n<h3>Bảo hành và đổi hàng</h3>\n<p>Quý khách xem trong phần bảo hành của shop<em><strong> <a href="http://fashionmen.net63.net/prestashop/vn/content/3-terms-and-conditions-of-use">tại đây</a></strong></em></p>\n</div>\n</li>\n<li><em class="icon-credit-card" id="icon-credit-card"></em>\n<div class="type-text">\n<h3>Thanh toán</h3>\n<p>Hỗ trợ thanh toán bằng hình thức chuyển khoản và thanh toán tại nhà (COD)</p>\n</div>\n</li>\n</ul>');
INSERT INTO `ps_info_lang` VALUES(2, 1, '<h3>Custom Block</h3>\n<p><strong class="dark">Lorem ipsum dolor sit amet conse ctetu</strong></p>\n<p>Sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit.</p>');
INSERT INTO `ps_info_lang` VALUES(2, 2, '<h2><strong>Fashionmen shop</strong></h2>\n<p>Chuyên cung cấp sỉ và lẻ quần áo thời trang nam, với những mẫu mới, hợp thời trang theo phong cách Hàn Quốc sẽ giúp bạn nổi bật cá tính. Giúp bạn sành điệu hơn, trẻ trung hơn</p>');
