INSERT INTO `ps_product_comment_criterion` VALUES(1, 1, 1);
INSERT INTO `ps_product_comment_criterion_lang` VALUES(1, 1, 'Quality');
INSERT INTO `ps_product_comment_criterion_lang` VALUES(1, 2, 'Quality');
INSERT INTO `ps_product_lang` VALUES(1, 1, 1, '<p>Fashion has been creating well-designed collections since 2010. The brand offers feminine designs delivering stylish separates and statement dresses which has since evolved into a full ready-to-wear collection in which every item is a vital part of a woman''s wardrobe. The result? Cool, easy, chic looks with youthful elegance and unmistakable signature style. All the beautiful pieces are made in Italy and manufactured with the greatest attention. Now Fashion extends to a range of accessories including shoes, hats, belts and more!</p>', '<p>Faded short sleeve t-shirt with high neckline. Soft and stretchy material for a comfortable fit. Accessorize with a straw hat and you''re ready for summer!</p>', 'faded-short-sleeve-tshirts', '', '', '', 'Faded Short Sleeve T-shirts', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(1, 1, 2, '<ul><li><strong>Quần short nam Homer</strong> với thiết kế ống suông, form rộng, sau lưng quần được may viền màu sang trọng, đường may cách điệu độc đáo</li>\n<li>Thiết kế 2 túi trước độ sâu vừa phải, thích hợp hợp cho bạn cất giữ các phụ kiện cá nhân</li>\n<li>Chất liệu thun mềm mịn, thấm hút mồ hôi, co giãn, tạo sự thoải mái cho người mặc</li>\n<li>Lưng thun phối dây rút tiện lợi, co giãn thoải mái</li>\n<li>Đường may tỉ mỉ, chắc chắn, khéo léo, có nhiều màu sắc hợp thời trang cho bạn chọn lựa</li>\n</ul>', '<p><strong>Quần short nam Homer</strong>: Chất liệu thun thoáng mát. Thiết kế ống suông, form rộng, sau lưng quần được may viền màu sang trọng, đường may cách điệu độc đáo.</p>', 'quan-short-nam-hormer', 'Quần short nam Homer: Chất liệu thun thoáng mát. Thiết kế ống suông, form rộng, sau lưng quần được may viền màu sang trọng, đường may cách điệu độc đáo..', '', 'Quần short nam Homer khuyến mãi giảm giá', 'Quần short nam Homer', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(2, 1, 1, '<p>Fashion has been creating well-designed collections since 2010. The brand offers feminine designs delivering stylish separates and statement dresses which has since evolved into a full ready-to-wear collection in which every item is a vital part of a woman''s wardrobe. The result? Cool, easy, chic looks with youthful elegance and unmistakable signature style. All the beautiful pieces are made in Italy and manufactured with the greatest attention. Now Fashion extends to a range of accessories including shoes, hats, belts and more!</p>', '<p>Short sleeved blouse with feminine draped sleeve detail.</p>', 'blouse', '', '', '', 'Blouse', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(2, 1, 2, '<ul><li><strong>Áo sơ mi nam denim Junior</strong> với form áo body nam tính, thiết kế cổ bẻ, tay dài phối nút gài lịch lãm</li>\n<li>2 túi trước ngực phối nút gài sang trọng, phong cách</li>\n<li>Màu wash ở cổ áo, thân áo hợp thời trang, thể hiện cá tính của người mặc</li>\n<li>Chất liệu vải denim mềm, bền, thấm hút mồ hôi đem lại sự thoải mái cho người mặc</li>\n<li>Đường may tỉ mỉ, nút bền đẹp, đem lại sự chắc chắn, bền đẹp cho sản phẩm</li>\n</ul>', '<p><strong>Áo sơ mi nam denim Junior</strong>: Chất liệu denim mềm mại, thông thoáng, thấm hút tốt. Thiết kế tay dài, cổ bẻ, form áo body mang đến vẻ đẹp lịch lãm, nam tính cho các bạn nam.</p>', 'ao-so-mi-nam-denim-junior', 'Áo sơ mi nam denim Junior: Chất liệu denim mềm mại, thông thoáng, thấm hút tốt. Thiết kế tay dài, cổ bẻ, form áo body mang đến vẻ đẹp lịch lãm, nam tính cho các bạn nam..', '', 'Áo sơ mi nam denim Junior Fashionmen', 'Áo sơ mi nam denim Junior', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(3, 1, 1, '<ul><li><strong>Áo khoác nỉ nam Ligi </strong>nổi bật với thiết kế 2 dây kéo phong cách, độc đáo</li>\n<li>Form áo body, cổ đứng phối nón vừa nam tính, vừa mang phong cách thể thao năng động, giúp bạn có thể bảo vệ cơ thể khỏi ánh nắng của mùa hè và cái se lạnh của mùa động</li>\n<li>Thiết kế phối màu sang trọng, đem lại vẻ ngoài nổi bật cho người mặc</li>\n<li>2 túi xéo trước có độ sâu vừa phải, giúp bạn có thể cất giữ các phụ kiện cá nhân như điện thoại, thẻ xe, chìa khóa...</li>\n<li>Tay áo và thân áo bo thun co giãn, tạo sự thoải mái cho bạn khi vận động</li>\n<li>Chất liệu nỉ mềm mịn, đường may chắc chắn, khéo léo, đem lại sự hoàn hảo cho sản phầm và một phong cách cá tính cho người mặc</li>\n</ul>', '<p><strong>Áo khoác nỉ nam Ligi</strong>: Chất liệu nỉ mềm mại, co giãn và thấm hút tốt. Thiết kế cổ đứng, tay dài, form áo body mang đến nét khỏe khoắn, nam tính cho các bạn nam.</p>', 'printed-dress', '', '', '', 'Printed Dress', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(3, 1, 2, '<ul><li><strong>Áo khoác nỉ nam Ligi </strong>nổi bật với thiết kế 2 dây kéo phong cách, độc đáo</li>\n<li>Form áo body, cổ đứng phối nón vừa nam tính, vừa mang phong cách thể thao năng động, giúp bạn có thể bảo vệ cơ thể khỏi ánh nắng của mùa hè và cái se lạnh của mùa động</li>\n<li>Thiết kế phối màu sang trọng, đem lại vẻ ngoài nổi bật cho người mặc</li>\n<li>2 túi xéo trước có độ sâu vừa phải, giúp bạn có thể cất giữ các phụ kiện cá nhân như điện thoại, thẻ xe, chìa khóa...</li>\n<li>Tay áo và thân áo bo thun co giãn, tạo sự thoải mái cho bạn khi vận động</li>\n<li>Chất liệu nỉ mềm mịn, đường may chắc chắn, khéo léo, đem lại sự hoàn hảo cho sản phầm và một phong cách cá tính cho người mặc</li>\n</ul>', '<p><strong>Áo khoác nỉ nam Ligi</strong>: Chất liệu nỉ mềm mại, co giãn và thấm hút tốt. Thiết kế cổ đứng, tay dài, form áo body mang đến nét khỏe khoắn, nam tính cho các bạn nam.</p>', 'ao-khoac-ni-nam-ligi', 'Áo khoác nỉ nam Ligi: Chất liệu nỉ mềm mại, co giãn và thấm hút tốt. Thiết kế cổ đứng, tay dài, form áo body mang đến nét khỏe khoắn, nam tính cho các bạn nam..', '', 'Áo khoác nỉ nam Ligi Fashionmen', 'Áo khoác nỉ nam Ligi', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(4, 1, 1, '<p>Fashion has been creating well-designed collections since 2010. The brand offers feminine designs delivering stylish separates and statement dresses which has since evolved into a full ready-to-wear collection in which every item is a vital part of a woman''s wardrobe. The result? Cool, easy, chic looks with youthful elegance and unmistakable signature style. All the beautiful pieces are made in Italy and manufactured with the greatest attention. Now Fashion extends to a range of accessories including shoes, hats, belts and more!</p>', '<p>Printed evening dress with straight sleeves with black thin waist belt and ruffled linings.</p>', 'printed-dress', '', '', '', 'Printed Dress', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(4, 1, 2, '<ul><li><strong>Áo thun nam tay dài Peter </strong>nổi bật với thiết kế tay raglang phối màu mang phong cách Hàn Quốc hợp thời trang</li>\n<li>Form áo body nam tinh, thiết kế tay dài, cổ tròn vừa đơn giản vừa sang trọng, lịch lãm, trước ngực phối túi vuông cá tính, độc đáo</li>\n<li>Chất liệu thun dày, co giãn, mềm mịn, thấm hút mồ hôi đem lại sự thoải  mái, ấm áp cho người mặc trong những ngày se lạnh</li>\n<li>Đường may khéo léo, tỉ mỉ, đem lại chỉn chu, hoàn mĩ cho sản phẩm</li>\n<li>Áo có nhiều màu sắc để bạn chọn lựa, dễ dàng phối đồ, phụ kiện</li>\n</ul>', '<p><strong>Áo thun nam tay dài Peter</strong>: Chất liệu thun dày mềm mịn. Thiết kế form áo body nam tinh, tay dài, cổ tròn vừa đơn giản vừa sang trọng, lịch lãm, trước ngực phối túi vuông cá tính, độc đáo.</p>', 'ao-thun-tay-dai-peter', 'Áo thun nam tay dài Peter: Chất liệu thun dày mềm mịn. Thiết kế form áo body nam tinh, tay dài, cổ tròn vừa đơn giản vừa sang trọng, lịch lãm, trước ngực phối túi vuông cá tính, độc đáo..', '', 'Áo thun nam tay dài Peter ', 'Áo thun nam tay dài Peter', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(5, 1, 1, '<ul><li><strong>Quần jean nam AJ</strong> thiết kế khá đơn giản, ống côn thời trang, thích hợp cho bạn nam yêu thích phong cách thời trang jean cổ điển</li>\n<li>2 túi sau lớn  được may phối viền nổi bật, sang trọng, bên cạnh đó có thể đựng bóp ví rất tiện lợi</li>\n<li>2 túi trước có độ sâu vừa phải, phối túi vuông nhỏ, giúp bạn có thể cất giữ các phụ kiện cá nhân nhỏ</li>\n<li>Chất liệu jean dày, bền đẹp, khó phai màu</li>\n<li>Đường may khéo léo, chắc chắn, nút và dây kéo bền. Đem lại sự yên tâm cho bạn khi vận động</li>\n<li>Màu sắc hợp thời trang, dễ dàng phối đồ</li>\n</ul>', '<p><strong>Quần jean nam AJ</strong>: Chất liệu jean mềm mại, thông thoáng, thấm hút tốt. Thiết kế quần ống ôm mang đến vẻ đẹp nam tính, lịch lãm cho các chàng trai.</p>', 'printed-summer-dress', '', '', '', 'Quần jean nam AJ', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(5, 1, 2, '<ul><li><strong>Quần jean nam AJ</strong> thiết kế khá đơn giản, ống côn thời trang, thích hợp cho bạn nam yêu thích phong cách thời trang jean cổ điển</li>\n<li>2 túi sau lớn  được may phối viền nổi bật, sang trọng, bên cạnh đó có thể đựng bóp ví rất tiện lợi</li>\n<li>2 túi trước có độ sâu vừa phải, phối túi vuông nhỏ, giúp bạn có thể cất giữ các phụ kiện cá nhân nhỏ</li>\n<li>Chất liệu jean dày, bền đẹp, khó phai màu</li>\n<li>Đường may khéo léo, chắc chắn, nút và dây kéo bền. Đem lại sự yên tâm cho bạn khi vận động</li>\n<li>Màu sắc hợp thời trang, dễ dàng phối đồ</li>\n</ul>', '<p><strong>Quần jean nam AJ</strong>: Chất liệu jean mềm mại, thông thoáng, thấm hút tốt. Thiết kế quần ống ôm mang đến vẻ đẹp nam tính, lịch lãm cho các chàng trai.</p>', 'quan-jean-nam-aj', 'Quần Jeans Nam AJ – Form Quần Đẹp – Chất Liệu Cao Cấp – Tôn Phong Cách Trẻ Trung, Sành Điệu Cùng Dáng Chuẩn Nam Tính. Giá 520.000 VNĐ, Còn 269.000 VNĐ, Giảm 48%. Chỉ Có Tại Hotdeal.vn!', '', 'Quần jean nam AJ', 'Quần jean nam AJ', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(6, 1, 1, '<p>Fashion has been creating well-designed collections since 2010. The brand offers feminine designs delivering stylish separates and statement dresses which has since evolved into a full ready-to-wear collection in which every item is a vital part of a woman''s wardrobe. The result? Cool, easy, chic looks with youthful elegance and unmistakable signature style. All the beautiful pieces are made in Italy and manufactured with the greatest attention. Now Fashion extends to a range of accessories including shoes, hats, belts and more!</p>', '<p>Sleeveless knee-length chiffon dress. V-neckline with elastic under the bust lining.</p>', 'printed-summer-dress', '', '', '', 'Printed Summer Dress', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(6, 1, 2, '<ul><li><strong>Quần tây nam MT thời trang</strong> chất liệu vải  cao cấp giúp bạn dễ dàng vận động mà không hề có cảm giác chật trội.</li>\n<li>Quần được thiết kế đơn giản mà vô cùng sang trọng cho người mặc, thiết kế quần ống đứng, túi xéo kết hợp túi mổ sau lưng, cùng màu sắc nhã nhặn vô cùng phù hợp với những nam nhân viên làm việc ở văn phòng, công sở.</li>\n<li>Bạn có thể kết hợp quần tây với các trang phục <a title="khác" href="http://www.sieumua.com/khac-90.html">khác</a> như áo sơ mi, áo phông, thắt lưng … và các phụ kiện thời trang <a title="khác" href="http://www.sieumua.com/khac-91.html">khác</a> để bạn nổi bật hơn trong mắt mọi người.</li>\n<li>Quần là sự lựa chọn hảo cho những bạn nam công sở, Hãy nhanh tay Click mua nhé!</li>\n</ul>', '<p><strong>Quần tây nam MT thời trang</strong>: Chất liệu vải cao cấp. Thiết kế quần ống đứng, túi xéo kết hợp túi mổ sau lưng, cùng màu sắc nhã nhặn vô cùng phù hợp với những nam nhân viên làm việc ở văn phòng, công sở</p>', 'quan-tay-nam-mt-thoi-trang', 'Chất liệu vải cao cấp. Thiết kế quần ống đứng, túi xéo kết hợp túi mổ sau lưng, cùng màu sắc nhã nhặn vô cùng phù hợp với những nam nhân viên làm việc ở văn phòng, công sở', '', 'quần tây nam mt thời trang ', 'Quần tây nam MT thời trang', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(7, 1, 1, '<p>Fashion has been creating well-designed collections since 2010. The brand offers feminine designs delivering stylish separates and statement dresses which has since evolved into a full ready-to-wear collection in which every item is a vital part of a woman''s wardrobe. The result? Cool, easy, chic looks with youthful elegance and unmistakable signature style. All the beautiful pieces are made in Italy and manufactured with the greatest attention. Now Fashion extends to a range of accessories including shoes, hats, belts and more!</p>', '<p>Printed chiffon knee length dress with tank straps. Deep v-neckline.</p>', 'printed-chiffon-dress', '', '', '', 'Áo sơ mi nam sọc đôi Mốt Trẻ', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES(7, 1, 2, '<ul><li><strong>Áo sơ mi nam sọc đôi Mốt Trẻ</strong> được thiết kế dài tay, chất liệu vải ka tê  mềm mát cao cấp, mềm mịn nên khả năng thấm hút mồ hôi rất tốt. Với những đường may tinh tế, khéo léo, áo may với form cực chuẩn, phù hợp với vóc dáng của người Việt Nam.</li>\n<li>Điểm nhấn họa tiết sọc đôi phá cách trên áo, làm chiếc áo sơ mi càng thêm nét cuốn hút. </li>\n<li>Dáng áo được thiết kế theo form dáng hiện đại, mang lại vẻ lịch lãm, sành điệu cho người mặc.</li>\n<li>Bạn có thể kết hợp áo với nhiều loại quần <a title="khác" href="http://www.sieumua.com/khac-90.html">khác</a> nhau như quần jeans, quần kaki, quần tây… Với mỗi loại quần, chiếc áo sẽ mang lại cho bạn một phong cách <a title="khác" href="http://www.sieumua.com/khac-91.html">khác</a> nhau nhưng luôn làm toát lên vẻ nam tính, lịch lãm.</li>\n</ul>', '<p><strong>Áo sơ mi nam sọc đôi Mốt Trẻ</strong>: Chất liệu katê thoáng và thấm hút. Thiết kế theo form dáng hiện đại, mang lại vẻ lịch lãm, sành điệu cho người mặc.</p>', 'ao-so-mi-nam-soc-doi-mot-tre', 'Áo sơ mi nam sọc đôi Mốt Trẻ: Chất liệu katê thoáng và thấm hút. Thiết kế theo form dáng hiện đại, mang lại vẻ lịch lãm, sành điệu cho người mặc..', '', 'Áo sơ mi nam sọc đôi Mốt Trẻ', 'Áo sơ mi nam sọc đôi Mốt Trẻ', 'In stock', '');
