INSERT INTO `ps_product_lang` VALUES(10, 1, 2, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Áo khoác nỉ nam Buggy </strong>nổi bật với thiết kế họa tiết caro độc đáo, tạo cho bạn 1 phong cách thời trang riêng</li>\n<li>Form áo thể thao, phù hợp với dáng người Việt, thiết kế cổ đứng viền caro nam tính, tay dài lịch lãm, giúp bảo vệ cơ thể bạn khỏi ánh nắng mùa hè, khoogn khí se lạnh mùa đông</li>\n<li>Thân áo là sự kết hợp hài hòa giữa caro và nỉ trơn màu đen</li>\n<li>2 túi trước được may vừa phải, vừa tiện lợi, giúp bạn có thể cất giữ các phụ kiện cá nhân</li>\n<li>Chất liệu nỉ mềm mịn, giữ ấm tốt, co giãn nhẹ, tạo sự thoải mái cho người mặc</li>\n<li>Đường may khéo léo, dây kéo chắc chắn, mượt đem lại sự chỉn chu, sang trọng cho người mặc</li>\n</ul></div>', '<p><strong>Áo khoác nỉ nam Buggy</strong>: Chất liệu nỉ mềm mịn, co giãn nhẹ. Thiết kế họa tiết caro độc đáo, tạo cho bạn một phong cách thời trang riêng.</p>', 'ao-khoac-ni-nam-bugg', 'Chất liệu nỉ mềm mịn, co giãn nhẹ. Thiết kế họa tiết caro độc đáo, tạo cho bạn một phong cách thời trang riêng.', '', 'Áo khoác nỉ nam Bugg', 'Áo khoác nỉ nam Bugg', '', '');
INSERT INTO `ps_product_lang` VALUES(11, 1, 1, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Áo khoác nỉ nam Idol</strong> với form body, thiết kế cổ trụ phối nút gài vừa nam tính, vừa lịch lãm</li>\n<li>Thiết kế tay dài bảo vệ bạn khỏi ánh nắng gay gắt của mùa hè và giữ ấm cơ thể trong ngày đông</li>\n<li>Trước ngực túi mổ phối nút sang trọng, độc đáo</li>\n<li>2 túi trước vừa tiện lợi, vừa tạo điểm nhấn cho sản phẩm, bạn cũng có thể sử dụng để cất giữ các phụ kiện cá nhân</li>\n<li>Chất liệu nỉ mềm mịn, dày dạn, giúp bạn giữ ấm cơ thể trong những ngày đông giá rét</li>\n<li>Màu sắc hợp thời trang, đường may chắc chắn, khéo léo, nút bền đẹp đem lại sự chỉn chu, sang trọng cho người mặc</li>\n</ul></div>', '<p><strong>Áo khoác nỉ nam Idol</strong>: Chất liệu nỉ mềm mịn, co giãn nhẹ. Thiết kế với form body, cổ trụ phối nút gài mang lại nét nam tính, lịch lãm cho các chàng trai.</p>', 'ao-khoac-n-nam-idol', '', '', '', 'Áo khoác nỉ nam Idol', '', '');
