INSERT INTO `ps_product_lang` VALUES(12, 1, 1, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Quần jean nam AJ</strong> thiết kế khá đơn giản, ống côn thời trang, thích hợp cho bạn nam yêu thích phong cách thời trang jean cổ điển</li>\n<li>2 túi sau lớn  được may phối viền nổi bật, sang trọng, bên cạnh đó có thể đựng bóp ví rất tiện lợi</li>\n<li>2 túi trước có độ sâu vừa phải, phối túi vuông nhỏ, giúp bạn có thể cất giữ các phụ kiện cá nhân nhỏ</li>\n<li>Chất liệu jean dày, bền đẹp, khó phai màu</li>\n<li>Đường may khéo léo, chắc chắn, nút và dây kéo bền. Đem lại sự yên tâm cho bạn khi vận động</li>\n<li>Màu sắc hợp thời trang, dễ dàng phối đồ</li>\n</ul></div>', '<p><strong>Quần jean nam AJ</strong>: Chất liệu jean mềm mại, thông thoáng, thấm hút tốt. Thiết kế quần ống ôm mang đến vẻ đẹp nam tính, lịch lãm cho các chàng trai.</p>', 'qun-jean-nam-aj', '', '', '', 'Quần jean nam AJ', '', '');
INSERT INTO `ps_product_lang` VALUES(12, 1, 2, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Quần jean nam AJ</strong> thiết kế khá đơn giản, ống côn thời trang, thích hợp cho bạn nam yêu thích phong cách thời trang jean cổ điển</li>\n<li>2 túi sau lớn  được may phối viền nổi bật, sang trọng, bên cạnh đó có thể đựng bóp ví rất tiện lợi</li>\n<li>2 túi trước có độ sâu vừa phải, phối túi vuông nhỏ, giúp bạn có thể cất giữ các phụ kiện cá nhân nhỏ</li>\n<li>Chất liệu jean dày, bền đẹp, khó phai màu</li>\n<li>Đường may khéo léo, chắc chắn, nút và dây kéo bền. Đem lại sự yên tâm cho bạn khi vận động</li>\n<li>Màu sắc hợp thời trang, dễ dàng phối đồ</li>\n</ul></div>', '<p><strong>Quần jean nam AJ</strong>: Chất liệu jean mềm mại, thông thoáng, thấm hút tốt. Thiết kế quần ống ôm mang đến vẻ đẹp nam tính, lịch lãm cho các chàng trai.</p>', 'quan-jean-nam-aj', 'Chất liệu jean mềm mại, thông thoáng, thấm hút tốt. Thiết kế quần ống ôm mang đến vẻ đẹp nam tính, lịch lãm cho các chàng trai.', '', 'Quần jean nam AJ', 'Quần jean nam AJ', '', '');
INSERT INTO `ps_product_lang` VALUES(13, 1, 1, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Quần jean dài nam Voschy</strong> xứng đáng có một vị trí "must have" trong bộ sưu tập thời trang của các chàng trai, mang đến cho phái mạnh phong cách năng động, trẻ trung.</li>\n<li>Quần Jeans được may bởi chất liệu vải jeans mềm mịn, thoáng mát, có chất lượng cao, co giãn tốt giúp bền màu quần và không bị biến dạng sau khi giặt.</li>\n<li>Thiết kế ống đứng thanh lịch, 2 túi trước và 2 túi sau đơn giản, nhưng đặc biệt không bao giờ lỗi thời, là kiểu trang phục  mà các chàng trai hiện đại ưa chuộng, đem lại vẻ năng động, cá tính cho phái mạnh.</li>\n<li>Form dáng suông khỏe khoắn, năng động, tôn lên vẻ đẹp nam tính và mạnh mẽ cho các chàng trai. Quần có đường may sắc sảo, đẹp mắt, tỉ mỉ trong từng chi tiết, có chạy chỉ màu cách điệu tạo nét tinh tế cho chiếc quần thêm thời trang.</li>\n</ul></div>', '<p><strong>Quần jean dài nam Voschy</strong>: Chất liệu vải jeans co giãn tốt. Thiết kế ống đứng, form suông mang đến vẻ đẹp lịch lãm, nam tính cho các bạn nam.</p>', 'qun-jean-dai-nam-voschy', '', '', '', 'Quần jean dài nam Voschy', '', '');
INSERT INTO `ps_product_lang` VALUES(13, 1, 2, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Quần jean dài nam Voschy</strong> xứng đáng có một vị trí "must have" trong bộ sưu tập thời trang của các chàng trai, mang đến cho phái mạnh phong cách năng động, trẻ trung.</li>\n<li>Quần Jeans được may bởi chất liệu vải jeans mềm mịn, thoáng mát, có chất lượng cao, co giãn tốt giúp bền màu quần và không bị biến dạng sau khi giặt.</li>\n<li>Thiết kế ống đứng thanh lịch, 2 túi trước và 2 túi sau đơn giản, nhưng đặc biệt không bao giờ lỗi thời, là kiểu trang phục  mà các chàng trai hiện đại ưa chuộng, đem lại vẻ năng động, cá tính cho phái mạnh.</li>\n<li>Form dáng suông khỏe khoắn, năng động, tôn lên vẻ đẹp nam tính và mạnh mẽ cho các chàng trai. Quần có đường may sắc sảo, đẹp mắt, tỉ mỉ trong từng chi tiết, có chạy chỉ màu cách điệu tạo nét tinh tế cho chiếc quần thêm thời trang.</li>\n</ul></div>', '<p><strong>Quần jean dài nam Voschy</strong>: Chất liệu vải jeans co giãn tốt. Thiết kế ống đứng, form suông mang đến vẻ đẹp lịch lãm, nam tính cho các bạn nam.</p>', 'quan-jean-dai-nam-voschy', 'Chất liệu vải jeans co giãn tốt. Thiết kế ống đứng, form suông mang đến vẻ đẹp lịch lãm, nam tính cho các bạn nam.', '', 'Quần jean dài nam Voschy', 'Quần jean dài nam Voschy', '', '');
INSERT INTO `ps_product_lang` VALUES(14, 1, 1, '<p><strong>Áo thun nam Tomo</strong>: Chất liệu thun cá sấu mềm mịn. Thiết kế cổ bẻ, tay ngắn lịch lãm, ngực trái thêu logo hình đại bàng kiêu hãnh, ngực phải in huy hiệu Ngựa đang tung vó sang trọng đầy cá tính.</p>', '<p><strong>Áo thun nam Tomo</strong>: Chất liệu thun cá sấu mềm mịn. Thiết kế cổ bẻ, tay ngắn lịch lãm, ngực trái thêu logo hình đại bàng kiêu hãnh, ngực phải in huy hiệu Ngựa đang tung vó sang trọng đầy cá tính.</p>', 'ao-thun-nam-tomo', '', '', '', 'Áo thun nam Tomo', '', '');
