INSERT INTO `ps_product_lang` VALUES(15, 1, 1, '<div class="title">ĐIỂM NỔI BẬT</div>\n<div class="overview">\n<ul><li><strong>Áo thun nam Lucky</strong> nổi bật với thiết kế phối màu mang phong cách Hàn Quốc trẻ trung, năng động</li>\n<li>Sự kết hợp tinh tế giữa thun cá sấu mềm mịn, co giãn, thấm hút mồ hôi cùng với chất liệu denim  ở cổ và túi dày dạn, đem lại hoàn hảo cho sản phẩm</li>\n<li>Trước ngực thiết kế túi giả phối nút sang trọng, cá tính</li>\n<li>Form áo body nam tính, thiết kể cổ bẻ lịch lãm, tay ngắn bo thun khỏe khoắn, năng động</li>\n<li>Đường may khéo léo, tỉ mỉ, chắc chắn, sẽ đem lại sự hài lòng cho người mặc.</li>\n</ul></div>', '<p><strong>Áo thun nam Lucky</strong>: Chất liệu thun co giãn, thấm hút. Thiết kế phối màu mang phong cách Hàn Quốc trẻ trung, năng động cho các chàng.</p>', 'ao-thun-nam-lucky', '', '', '', 'Áo thun nam Lucky', '', '');
